import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Navigation from './Navigation';
import Login from './Login'; // Import your Login component
import Register from './Register'; // Import your Register component
import Dashboard from './Dashboard'; // Import a single Dashboard component
import NotFound from './NotFound'; // Import a 404 Not Found component

function App() {
  return (
    <Router>
      <div>
        <Navigation />
        <Switch>
          <Route path="/" exact component={Dashboard} />
          <Route path="/login" component={Login} />
          <Route path="/register" component={Register} />
          <Route path="/patient" component={Dashboard} />
          <Route path="/doctor" component={Dashboard} />
          {/* Add more routes for other user roles */}
          <Route component={NotFound} /> {/* Handle 404 Not Found */}
        </Switch>
      </div>
    </Router>
  );
}

export default App;
